pragma solidity ^0.5.0;
//pragma experimental ABIEncoderV2;
import "openzeppelin-solidity/contracts/token/ERC721/ERC721.sol";

contract EYReward is ERC721 {

    struct Reward {
        uint256 year;
        string award;
        string group;
        string name;
    }
    mapping (uint256 => Reward) private _awardMap;
    uint256[] _awardList = new uint256[](1);

    event RewardToken(address _to, uint256 _tokenId, uint256 _year, string _awardName, string _group, string _name);
    event RevokeToken(uint256 _tokenId);

    function autoExendArray(uint256 _token) internal returns (uint256){
        _awardList[_awardList.length++] = _token;
        return _awardList[_awardList.length - 1];
    }

    function rewardToken(
        address _to, uint256 _tokenId, uint256 _year, string memory _awardName, string memory _group, string memory _name
    ) public returns(uint256){
        super._mint(_to, _tokenId);
        Reward memory reward = Reward(_year,_awardName, _group, _name);
        _awardMap[_tokenId] = reward;
        autoExendArray(_tokenId);
        emit RewardToken(_to,_tokenId,_year,_awardName,_group,_name);
        return _tokenId;
    }

    function getToken(uint256 _tokenId) public view returns (uint year, string memory award, string memory group, string memory name){
        //require(_awardMap[_tokenId]!=0x0);
        Reward memory reward = _awardMap[_tokenId];
        name = reward.name;
        year = reward.year;
        award = reward.award;
        group = reward.group;

    }
    function getTokenList() public view returns (uint256[] memory){
        return _awardList;
    }
    function tokenExist(uint256 _tokenId) public view returns (bool){
        return super._exists(_tokenId);
    }
}
